import Dashboard from "views/Dashboard.js";
import Notifications from "views/Notifications.js";
import Icons from "views/Icons.js";
import BuscarAutor from "views/BuscarAutor.js";
import ListaAutores from "views/ListaAutores.js";
import ListaLibros from "views/ListaLibros";
import Upgrade from "views/Upgrade.js";
import AddAutor from "views/AddAutor.js";
import AddLibro from "views/AddLibro.js";

var dashRoutes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "design_app",
    component: <Dashboard />,
    layout: "/admin",
  },
  {
    path: "/icons",
    name: "Icons",
    icon: "design_image",
    component: <Icons />,
    layout: "/admin",
  },
  {
    path: "/add-libro",
    name: "Agregar Libro",
    icon: "education_agenda-bookmark",
    component: <AddLibro />,
    layout: "/admin",
  },
  {
    path: "/mlaps",
    name: "Maps",
    icon: "location_map-big",
    component: <Maps />,
    layout: "/admin",
  },
  {
    path: "/notifications",
    name: "Notifications",
    icon: "ui-1_bell-53",
    component: <Notifications />,
    layout: "/admin",
  },
  {
    path: "/add-autor",
    name: "Agregar Autor",
    icon: "users_single-02",
    component: <AddAutor />,
    layout: "/admin",
  },
  {
    path: "/lista-autores",
    name: "Lista de Autores",
    icon: "files_paper",
    component: <ListaAutores />,
    layout: "/admin",
  },
  {
    path: "/buscar-autor",
    name: "Buscar Autor",
    icon: "ui-1_zoom-bold",
    component: <BuscarAutor />,
    layout: "/admin",
  },
  {
    pro: true,
    path: "/upgrade",
    name: "Upgrade to PRO",
    icon: "objects_spaceship",
    component: <Upgrade />,
    layout: "/admin",
  },
];
export default dashRoutes;
